import React from 'react';
import T from 'prop-types';
import s from './Auth.module.scss';
import { Header } from '../../components';

function Auth() {
  return (
    <div className={s.container}>
      <Header />
    </div>
  );
}

Auth.propTypes = {};

export default Auth;
